import React from "react"

function Footer(){
    return(
        <footer className="bg-gray-300 text-center text-xs p-3 absolute bottom-0 w-full">
            &copy; {new Date().getFullYear()} Trip Event Organizer
        </footer>
    )
}

export default Footer
